  return (
    <Container maxWidth='lg'>
      <AppBar position='static' color='inherit'>
        <Typography variant='h2' align='center'>Memories</Typography>
        <img src={memories} alt='memories' height='60'/>
      </AppBar>
      <Grow in> {/* 该组件用来生成一些简单的国度动画。in表示显示该组件 */}

      </Grow>
    </Container>
  )
}

export default App
